import React, { useState } from 'react';
import { 
  FaDatabase, 
  FaCode, 
  FaReact, 
  FaJsSquare, 
  FaDocker, 
  FaHtml5, 
  FaCss3Alt, 
  FaMobileAlt 
} from 'react-icons/fa';

// Use only the icons that are available from react-icons/si
import { SiDotnet, SiAdobexd, SiKubernetes, SiFigma } from 'react-icons/si';

import './About.css';

const getSkillIcon = (skill) => {
  // Convert skill name to lowercase for matching
  switch (skill.toLowerCase()) {
    case 'asp.net core':
      return <SiDotnet />;
    case 'c#':
      // SiCsharp is not available, so we use a generic code icon
      return <FaCode />;
    case 'sql server':
      return <FaDatabase />;
    case 'azure devops':
      // SiAzuredevops is not available; use fallback icon
      return <FaCode />;
    case 'docker':
      return <FaDocker />;
    case 'javascript':
      return <FaJsSquare />;
    case 'reactjs':
      return <FaReact />;
    case 'kubernetes':
      return <SiKubernetes />;
    case 'figma':
      return <SiFigma />;
    case 'adobe xd':
      return <SiAdobexd />;
    case 'html':
      return <FaHtml5 />;
    case 'css':
      return <FaCss3Alt />;
    case 'responsive design':
      return <FaMobileAlt />;
    default:
      return <FaCode />;
  }
};

const ExperienceCard = ({ company, role, duration, description, skills }) => {
  const [flipped, setFlipped] = useState(false);

  const toggleFlip = () => setFlipped(!flipped);

  return (
    <div className="card-container">
      <div className={`card ${flipped ? 'flipped' : ''}`}>
        <div className="card-front">
          <h3>{company}</h3><br/>
          <p><strong>{role}</strong></p>
          <p>{duration}</p><br/>
          <p>{description}</p><br/>
          <button className="card-btn" onClick={toggleFlip}>Show Skills</button>
        </div>
        <div className="card-back">
          <h3>Skills Used</h3><br/>
          <ul className="skills-list">
            {skills.map((skill, index) => (
              <li key={index}>
                <span className="skill-icon">{getSkillIcon(skill)}</span>
                <span className="skill-text">{skill}</span>
              </li>
            ))}
          </ul>
          <button className="card-btn" onClick={toggleFlip}>Show Experience</button>
        </div>
      </div>
    </div>
  );
};

const About = () => {
  return (
    <section id="about" className="about">
      <div className="cards-container">
        <ExperienceCard
          company="Collins Aerospace"
          role="Software Engineer"
          duration="Nov 2022 – July 2024"
          description="Developed secure, scalable web applications and RESTful services using ASP.NET Core, C#, and SQL Server."
          skills={["ASP.NET Core", "C#", "SQL Server", "Azure DevOps", "Docker"]}
        />
        <ExperienceCard
          company="Starmark Software Pvt Ltd"
          role="Associate Software Engineer"
          duration="Aug 2021 – Nov 2022"
          description="Built secure REST APIs and collaborated with product teams to enhance web applications."
          skills={["C#", "JavaScript", "ReactJS", "SQL", "Kubernetes"]}
        />
        <ExperienceCard
          company="Traxeat"
          role="UI/UX Designer Intern"
          duration="Oct 2020 – Jan 2021"
          description="Designed intuitive user interfaces and prototypes for web and mobile applications."
          skills={["Figma", "Adobe XD", "HTML", "CSS", "Responsive Design"]}
        />
      </div>
    </section>
  );
};

export default About;
